import Task from './Task'

const Tasks = ({ tasks , onDelete, updateTask, onToggle}) => {

  return (
    <div>
      {tasks.map((task) => {
        return <Task 
        key={task.id} 
        task={task} 
        onDelete={onDelete}
        updateTask={onEdit}
        onToggle={onToggle}
        />
      })}
    </div>
  )
}

export default Tasks
